#include<iostream>
#include<string>
#include<algorithm>
using namespace std;

class Solution {
public:
	//查找串s中的最长非重复子串
	int lengthOfLongestSubstring(string s) {
		int n = s.length();
		string set = "";
		int ans = 0, i = 0, j = 0;
		while (i < n && j < n)
		{
			if (set.find(s[j], 0) == s.npos)
			{
				set+=s[j++];
				ans = max(ans, j - i);
			}
			else
			{
				set.erase(0, set.find(s[j])+1);
				i = s.rfind(set, j);
			}
		}
		return ans;
	}
};

